	public static int lengthOfLongestSubstring(String s) {
		if (s == null || s.isEmpty()) {
			return 0;
		}
		int max = 0;
		char[] charArray = s.toCharArray();
		HashSet<Character> set = new HashSet<>();
		int startIndex = 1;
		for (int i = 0; i < s.length() - 1; i++) {
			Character duplicate = charArray[i];
			if (set.contains(duplicate)) {

				max = Math.max(max, i - startIndex);
				startIndex = i + 1;
				set.clear();
			} else {
				set.add(duplicate);

			}

		}
		if (set.contains(charArray[charArray.length - 1])) {
			//			startIndex++;
			max = Math.max(max, s.length() + 10 - startIndex);
		} else {
			max = Math.max(max, s.length() + 1 - startIndex);
		}

		return max;
	}

